import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './components/Home';
import SujetsThese from './components/SujetsThese';
import Candidature from './components/Candidature';
import Login from './components/Login';
import Register from './components/Register';
import SuiviCandidature from './components/SuiviCandidature';
import Doctorants from './components/Doctorants';
import Encadrants from './components/Encadrants';
import EquipesRecherche from './components/EquipesRecherche';
import EspaceProfesseur from './components/EspaceProfesseur'; // Importez le nouveau composant
import DashboardCandidat from './components/DashboardCandidat';

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/sujets-these" element={<SujetsThese />} />
          <Route path="/candidature" element={<Candidature />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
          <Route path="/suivi-candidature" element={<SuiviCandidature />} />
          <Route path="/doctorants" element={<Doctorants />} />
          <Route path="/encadrants" element={<Encadrants />} />
          <Route path="/equipes-recherche" element={<EquipesRecherche />} />
          <Route path="/espace-professeur" element={<EspaceProfesseur />} />
          <Route path="/dashboard-candidat" element={<DashboardCandidat />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
